    def test_join_rectangles(self):
        rects = [Rect(1,1,1,1), Rect(1,3,1,1), Rect(1,5,1,1), Rect(3,1,1,1), Rect(3,3,1,1),
                 Rect(3,5,1,1), Rect(7,1,1,1), Rect(7,3,1,1), Rect(7,5,1,1)]

        g, joined_rects = join_rectangles(rects)
        assert(len(joined_rects) == 0)

        rects = [Rect(1, 1, 3, 3), Rect(3, 3, 3, 3)]
        g, joined_rects = join_rectangles(rects)
        assert(len(joined_rects) == 1)

        rects = [Rect(1, 1, 2, 3), Rect(2, 3, 4, 2), Rect(7, 4, 2, 3), Rect(8, 2, 2, 3), Rect(6, 6, 2, 2)]
        g, joined_rects = join_rectangles(rects)
        assert(len(joined_rects)==2)
        assert(len(g.edges)==3)

        rects = [Rect(1, 1, 1, 1), Rect(3, 1, 1, 1), Rect(5, 1, 1, 1), Rect(2, 3, 1, 1), Rect(4, 3, 1, 1), Rect(1,5,1,1), Rect(3,5,1,1), Rect(5,5,1,1)]
        g, joined_rects = join_rectangles(rects)
        assert(len(joined_rects)==0)


